import React from 'react';
import Star from '../assets/star.png'; 
import locations from '../locations.json'; // Assuming you import locations data
import { useParams } from 'react-router-dom'; // Import useParams hook to get the ID
import "../Locations.css";

const RatingStars = () => {
    const { id } = useParams(); // Get the ID from the URL params
    const location = locations.find(location => location.id === id); // Find the location based on the ID
    
    if (!location) {
        return null; // Return null if location is not found
    }

    const starArray = [];
    const totalStars = 5; // Total number of stars

    for (let i = 1; i <= totalStars; i++) {
        if (i <= parseInt(location.rating)) { // Convert rating to integer and compare
            starArray.push(<img key={i} src={Star} alt="star" className="star-filled" />);
        } else {
            starArray.push(<img key={i} src={Star} alt="star" className="star-empty" />);
        }
    }

    return (
        <div className="rating__stars">
            {starArray}
        </div>
    );
};

export default RatingStars;
